package com.yihexinda.core.response;import lombok.Data;/** * 给用户的派单信息 */@Datapublic class UserVehicle {    public String orderID;    public String userID;    public String vehicleID;    public UserVehicle(){}    public UserVehicle(String orderID, String userID, String vehicleID) {        this.orderID = orderID;        this.userID = userID;        this.vehicleID = vehicleID;    }    public String getOrderID() {        return orderID;    }    public void setOrderID(String orderID) {        this.orderID = orderID;    }    public String getUserID() {        return userID;    }    public void setUserID(String userID) {        this.userID = userID;    }    public String getVehicleID() {        return vehicleID;    }    public void setVehicleID(String vehicleID) {        this.vehicleID = vehicleID;    }    @Override    public String toString() {        return "UserVehicle{" +                "orderID='" + orderID + '\'' +                ", userID='" + userID + '\'' +                ", vehicleID='" + vehicleID + '\'' +                '}';    }}